import React from "react";
import axios from "axios";
import {BASE_URL} from "../utils/api";

function Home() {
   const getDocuments = () =>{
       axios.get(`${BASE_URL}/document/`)
       .then((response)=>{
           console.log(response);
       })
       .catch((error)=>{console.log(error)});
   }
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-md-4 home-col shadow-lg">
          <h2>Welcome Advyth</h2>
          <div className="image-bg shadow-lg">
            <img
              src="https://retro-avatar.s3.amazonaws.com/avatar_5c0533500f0dc351421d2c6c50717252.png"
              height={50}
              width={50}
            />
          </div>
          <div className="col-md-11 home-file-col">
            <div className="file shadow-sm">
              <h6>Resume.doc</h6>
              <h6>By Advyth</h6>
            </div>
            <div className="file shadow-sm">
              <h6>Resume.doc</h6>
              <h6>By Advyth</h6>
            </div>
            <div className="file shadow-sm">
              <h6>Resume.doc</h6>
              <h6>By Advyth</h6>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
